import React from 'react';
import './styles/Header.scss';
// Header 컴포넌트 정의
function Header() {
  return (
    <header>
      <div>
        <h3 style={headerStyle}>⚖️BALANCETALK</h3>
      </div>
    </header>
  );
}

export default Header;
